impl Solution {
    pub fn number_of_powerful_int(start: i64, finish: i64, limit: i32, s: String) -> i64 {
        if limit == 0 {
            return 0;
        }

        let s_int = s.parse::<i64>().unwrap();
        let mut count = 0;
        let mut base = 1;

        while base < finish {
            let current = base * 10_i64.pow(s.len() as u32) + s_int;
            if current > finish {
                break;
            }
            if current >= start && current <= finish {
                let mut valid = true;
                let mut temp = base;
                while temp > 0 {
                    if temp % 10 > limit as i64 {
                        valid = false;
                        break;
                    }
                    temp /= 10;
                }
                if valid {
                    count += 1;
                }
            }
            base += 1;
        }

        count
    }
}
